import React from "react";
// Import Component MUI
import {
  Box,
  Container,
  Grid,
  Typography,
  // Button,
  IconButton,
} from "@mui/material";

// Import Icon
import ChevronLeftRoundedIcon from "@mui/icons-material/ChevronLeftRounded";
import SearchIcon from "@mui/icons-material/Search";

export default function ListSeritifikat() {
  return (
    <div>
      <Container>
        <Box>
          <Grid>
            <Grid item xs={12}>
              <IconButton>
                <ChevronLeftRoundedIcon />
                <Typography>Sertifikat</Typography>
              </IconButton>
            </Grid>

            <Grid>
              <Search>
                <SearchIconWrapper>
                  <SearchIcon />
                </SearchIconWrapper>
                <StyledInputBase
                  placeholder="Searchâ€¦"
                  inputProps={{ "aria-label": "search" }}
                />
              </Search>
            </Grid>
          </Grid>
        </Box>
      </Container>
    </div>
  );
}
